import React, { Component } from 'react'
import Link from 'next/link'

class Navbar extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div className="container">
                <nav>
                    <Link href='/'>
                        <a title="Our API">
                            Home
                    </a>
                    </Link>
                    <Link href="/about">
                        <a title="About NextJS">About NexxtJS</a>
                    </Link>
                    <style jsx>
                        {`
                        nav {
                            background : blue;
                        }
                        nav a {
                            padding : 10px 20px;
                            text-decoration : none;
                            color : black;
                        }
                    `}
                    </style>
                </nav>
            </div>
        )
    }
}
export default Navbar
